import Router from "./route/Router"
import {createGlobalStyle} from "styled-components";


const GlobalStyle = createGlobalStyle`
    body{
    margin: 30px 0;
    padding: 0;
    width: 100vw;
    min-height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;

    }

    button {

    margin-bottom: 15px;
    height: 40px;
    padding: 0 20px;
    border-radius: 20px;
    border: none;
    color: white;
    font-size: 16px;
    background-color: slategray;
    min-width: 100px;

    &:hover{
      cursor: pointer;
      background-color: #b6d4e3;
    }


    }

    h1, h2, b {
    color: slategray;
  }

  h1 {
    text-align: center;
    font-family: Open-Sans, Helvetica, Sans-Serif;
  }

  h2 {
    text-align: center;

    font-family: Open-Sans, Helvetica, Sans-Serif;
  }

  p {
    color: #394145;
    font-family: Open-Sans, Helvetica, Sans-Serif;
  }
}
`


const App = () => {
  return (
    <div>
    <GlobalStyle/>

    <Router/>




    </div>
  );
}

export default App;
